import React from 'react';
import { Link } from 'react-router-dom';

function AboutPage(props) {
    return (
        <div className={'text-3xl'}>

            <div className={'flex'}>
                <Link to={'/'}>Main Go</Link>
            </div>
            <div>AboutPage</div>
        </div>
    );
}

export default AboutPage;
